import React, { Component } from 'react'
import './Dashboard.css'

import CiteService from './../../../service/cite.service'

import CiteCard from '../cites/CiteCard'
import QueryCard from '../query/QueryCard'

import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import Figure from 'react-bootstrap/Figure'
import FigureImage from 'react-bootstrap/FigureImage'
import Form from 'react-bootstrap/Form'
import Button from 'react-bootstrap/Button'

import { Link } from 'react-router-dom'


class Dashboard extends Component {

    constructor(props) {
        super(props)
        this.state = { 
            userInfo: {
                querys: [],
                cites: ""
            },
            toast: {
                show: false,
                text: ''
            },
            modalShow: false

        }
        this.citeService = new CiteService()
    }

    handleModal = visible => this.setState({ modalShow: visible })

    getCitesInfo = () => {
        this.citeService.citesFromUser(this.props.loggedInUser._id)
            .then(response => this.setState({ cites: response.data }))
            .catch(err => console.log(err))
    }


    componentDidMount = () => {
        this.getCitesInfo()

    }


    render() {

        console.log(this.props.loggedInUser._id)
        console.log(this.state.cites)

        return (
            <>
                <Container as="section" >
                    <Row>
                        <Col>
                            {/* utilizar con estos botones un renderizado condicional
                         segun el role del usuario */}
                            <Button></Button>

                        </Col>
                        <Col>
                            <Button></Button>

                        </Col>
                        <Col>
                            <Button></Button>
                        </Col>

                    </Row>
                </Container>

                <Container as="section" >

                <h1>Citas</h1>


                    {this.state.cites && this.state.cites.map(cite =>  <CiteCard key={cite._id} {...cite} />)}


                </Container>

                <Container as="section" >

                    {/* {this.state.query && this.state.query.map(query => <QueryCard key={query._id} {...query} />)} */}


                </Container>
            </>

        )
    }
}

export default Dashboard
